import React, { Component } from 'react'

class Courier extends Component {
  constructor(props) {
    super(props)
    this.state = {
      recvData: {},
    }
  }
  componentDidMount() {
    let recvParam

    if (this.props.location&& this.props.location.query.record) {
      //To see if parameters exist
      recvParam = location.query.record
      sessionStorage.setItem('data', recvParam) // store recvParam in sessionStorage
    } else {
      recvParam = sessionStorage.getItem('data')
    }

    this.setState({
      recvData: recvParam
    })

    console.log('recvParam', recvParam)
  }

  render() {
    return <div id="content">aaaaa {this.props.location.query.tn}</div>
  }
}

export default Courier
